import React from 'react';
import ReactDOM from 'react-dom';

export class Nav extends React.Component {
    render() {
        return (
            <div className="row">
                <h3>George Kilburg</h3>
                <div>Home</div>
                <div>Details</div>
                <div>Contact</div>
            </div>
        );
    }
}

ReactDOM.render(<Nav />, document.getElementById('root'))
